import axios from 'axios';

export default class LoginForm extends React.Component{
    getdata(){
        var self =this;
        var username="hhkk";
            var password="1425";
            axios.post('http://127.0.0.1:8000/login/',null,{data:{username,password}})
            .then(res=>{console.log(res)})
            .catch(error=>{
                console.log(error)
            });
        axios.get('http://127.0.0.1:8000/data/user/')
            .then((response)=> { 
                console.log(response.data);
            })
            .catch(function(error){
                console.log(error);
            });
    }
    render(){
        return(<div id="login">
    <label >Username:</label>
    <input type="text" name="username" /> 
    <label>Password:</label>
    <input type="password" name="password" />
    <button onClick={this.getdata} type="submit" value="Login">login</button>
    </div>
        );
    }
}
